  setPassword === setVerifyPassword ? true: null

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post("http://localhost:8000/signin", {
        username,
        password,
      });
      console.log("Server response:", response.data);
    } catch (error) {
      console.error("Error occurred:", error);
    }
    setUsername("");
    setPassword("");
  };

